import classes from './Nav.module.css'

// let classes = {
//     'nav': 'Nav_nav__2k3D9',
//     'item': 'Nav_item__18bSP'
// }

const Navbar = () => {
    return  <nav className={classes.nav}>
        <div><a className={classes.item} href='#'>Profile</a></div>
        <div><a className={classes.item} href='#'>Messages</a></div>
        <div><a className={classes.item} href='#'>News</a></div>
        <div><a className={classes.item} href='#'>Music</a></div><br/>
        <div><a className={classes.item} href='#'>Setting</a></div>
    </nav>
}

export default Navbar;
